Waking Madison (2010)


After a failed suicide attempt, Madison Walker (Sarah Roemer) locks herself in her apartment with a video camera for thirty days to cure her Dissociative Identity Disorder. But instead of finding salvation, Madison is thrown into the purgatory of her mind, where she must face her tortured past in order to be free.

